import Foundation

enum TestResource {
    // swiftlint:disable:next line_length
    private static let genbaNekoBase64 = #""#

    // swiftlint:disable:next line_length
    private static let denwaNekoBase64 = #""#
}

extension TestResource {
    static var genbaNeko: Data { Data(base64Encoded: genbaNekoBase64, options: .ignoreUnknownCharacters)! }
    static var denwaNeko: Data { Data(base64Encoded: denwaNekoBase64, options: .ignoreUnknownCharacters)! }
}
